import SearchBar from '../Search/SearchBar.jsx'
import {Link} from 'react-router-dom'

export default function Nav({onSearch}) {
   return (
    <div>
        <SearchBar onSearch={onSearch}/>
        <Link to='/'>
            <p>Home</p>
        </Link>
            
        <Link to='/about'>
            <p>About</p>
        </Link>
    </div>
   );
}
